import React from 'react';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import cover from '../about.jpg'

function About() {
  return (
    <div>
        <h3>About</h3>
        <div class="parallax-container">
            <div class="parallax"><img src={cover}/></div>
        </div>
    </div>
  );
}

export default About;
